import React from 'react';
function Header() {
    return (
        <div className='styleSelection grid-container'>
            <div>
                <h4>Top Tube</h4>
            </div>
            <div>
                <h4>Front</h4>
            </div>
            <div>
                <h4>Full</h4>
            </div>
        </div>
    )
}

export default Header;
